import React from "react";
import styles from "./Navbar.module.css";

const Navbar = props => {
  return (
    <div>
      <div className={styles.header__logo}></div>
      <nav className={styles.header__nav}>
        <a className={styles.nav__link} href="#">
          Главная
        </a>
        <a className={styles.nav__link} href="#">
          Стоимость
        </a>
        <a className={styles.nav__link} href="#">
          онлайн конструктор
        </a>
        <a className={styles.nav__link} href="#">
          почему мы
        </a>
        <a className={styles.nav__link} href="#">
          отзывы
        </a>
        <a className={styles.nav__link} href="#">
          заказать
        </a>
      </nav>
    </div>
  );
};

export default Navbar;
